import React, { useState, useEffect } from "react";

export default function AdminPreferences() {
  const [rankedPrefs, setRankedPrefs] = useState([]);
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    fetch("http://localhost:5000/api/users", {
      headers: { Authorization: `Bearer ${localStorage.getItem("token")}` },
    })
      .then((res) => res.json())
      .then((users) => {
        const counts = {};
        users.forEach((user) => {
          if (user.preferences && user.preferences.length) {
            user.preferences.forEach((pref) => {
              counts[pref] = (counts[pref] || 0) + 1;
            });
          }
        });

        const ranked = Object.entries(counts)
          .map(([pref, count]) => ({ preference: pref, count }))
          .sort((a, b) => b.count - a.count);

        setRankedPrefs(ranked);
        setLoading(false);
      })
      .catch((err) => {
        console.error("Error fetching users:", err);
        setLoading(false);
      });
  }, []);

  return (
    <div style={{ marginLeft: 220, padding: 20 }}>
      <h2>Most Common Preferences</h2>
      {loading ? (
        <p>Loading...</p>
      ) : rankedPrefs.length === 0 ? (
        <p>No preferences found.</p>
      ) : (
        <table style={{ width: "50%", borderCollapse: "collapse" }}>
          <thead>
            <tr>
              <th style={{ border: "1px solid #ccc", padding: 8 }}>Rank</th>
              <th style={{ border: "1px solid #ccc", padding: 8 }}>Preference</th>
              <th style={{ border: "1px solid #ccc", padding: 8 }}>Count</th>
            </tr>
          </thead>
          <tbody>
            {rankedPrefs.map((item, index) => (
              <tr key={item.preference}>
                <td style={{ border: "1px solid #ccc", padding: 8 }}>{index + 1}</td>
                <td style={{ border: "1px solid #ccc", padding: 8 }}>{item.preference}</td>
                <td style={{ border: "1px solid #ccc", padding: 8 }}>{item.count}</td>
              </tr>
            ))}
          </tbody>
        </table>
      )}
    </div>
  );
}
